import './App.css';
import {BrowserRouter as Router} from 'react-router-dom'

import NavBar from './NavBar'
import Destination from './Destination'
import Destinations from './Destinations'
import CreateDestination from './CreateDestination'

function App() {

  return (
    <div className='app'>



      <Router>


        <Destination path='/destination/:id' component={Destination} /> 
        <Destinations path='/destinations' component={Destinations} />
        <CreateDestination path='/adddestination' component={CreateDestination} />
      </Router>



    </div>
  )
}

export default App;
